import React from 'react';

const YourBotArmy = ({ bots, onRelease, onDischarge }) => {
  return (
    <div>
      <h2>Your Bot Army</h2>
      <ul>
        {bots.map(bot => (
          <li key={bot.id}>
            <p>{bot.name}</p>
            <button onClick={() => onRelease(bot)}>Release</button>
            <button onClick={() => onDischarge(bot)}>Discharge</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default YourBotArmy;
